I really hope Hughes doesn’t regress he was such a force last year for Van and I think Hovart has a chance to be a special leader. 

But both teams were so undisciplined 🤦‍♂️

@MatthewRagogna5 low scoring football game. 

Rubber match on Saturday. Toffoli is having himself a series!  Who would let this kid walk?

Also as a math teacher, need to point out that points earned so far is 3-2 so technically Habs are ahead. https://t.co/2NvHiIiLv0

@cetmanski What is your board doing in terms of hybrid learning hardware?

I will need luck for sure, but I do anticipate @SCDSB_Schools will provide us with some directive for set up. 

Right now just looking for what others have done with these cameras, especially in a math class

@cetmanski Actually it’s the best plan. They’ve been laser focused since March. 

Time to get my “new” mask on which seems thinner than the rest. 

10 years from now this better be a funny period to look back on 🤷‍♂️

Synchronous learning is a challenge at the best of times. 

For example, telling my students to watch a video but not including the links makes it difficult to have them understand the lesson. 

@Sflecce you can add the link by pasting it within your tweet #alwayslearning #onpoli https://t.co/bpX3q1TVwM

@MikeJToronto I have a policy of not commenting on individuals, so I’ll share my observations of what makes an effective Minister (having worked with many):
They may spin a message a little but not blatantly lie &amp;, when found out, double down on the lies;
1/

